create table user (
	user_id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	age INT,
	email VARCHAR(50),
	gender VARCHAR(50),
	city VARCHAR(50),
	country VARCHAR(50),
	phone_number VARCHAR(50),
	birthdate DATE,
	registration_date DATE,
	favorite_color VARCHAR(6),
	language VARCHAR(50),
	job_title VARCHAR(50),
	street_address VARCHAR(50),
	postal_code VARCHAR(50),
	avatar_url VARCHAR(50),
	company_name VARCHAR(50),
	income DECIMAL(8,2),
	education_level VARCHAR(19),
	relationship_status VARCHAR(17),
	interests VARCHAR(7),
	subscription_status VARCHAR(50),
	last_login DATE,
	account_balance DECIMAL(7,2),
	membership_level VARCHAR(7),
	profile_views INT,
	social_media_handles VARCHAR(10),
	loyalty_points INT,
	newsletter_subscription VARCHAR(50)
);
